import React from "react";
import "./nav.css";
import { Link } from "react-router-dom";
import { FaTimes, FaBars } from "react-icons/fa";

const Nav = () => {
  return (
    <div className="nav">
      <div className="logo">
        <Link className="logo anchor1">Galaxy</Link>
      </div>
      <div className="anchor">
        <Link to="/" className="anchor1">
          Home
        </Link>
        <Link to="/pricing" className="anchor1">
          Pricing
        </Link>
        <Link to="/training" className="anchor1">
          Training
        </Link>
        <Link to="/contact" className="anchor1">
          Contact
        </Link>
      </div>
      <div class="Hamburger">
        <FaBars style={{ color: "white", cursor: "pointer" }} />
      </div>
      <div class="Hamburger">
        <FaTimes style={{ color: "white", cursor: "pointer" }} />
      </div>
    </div>
  );
};

export default Nav;
